import React from 'react'
import "./SecondProposal.css";
const SecondProposal = () => {
  return (
    <div>  
    <div className="SecondProposal">
      <h1> Premium membership for token owners</h1>
      <button></button>
      <p className="SecondProposaltext">Summary. Create the Freedom Tower virtual NFT gallery in the metaverse and make it accesible to anyone, anywhere, all for free.</p>

    </div>

    </div>
  )
}

export default SecondProposal
